description:
It's freezing and snowing, this not really a good time for tourist activity, but Winnie doesn't want to miss the opportunity to snap some pictures!! While she's sightseeing, she almost slides on the ice but Zenza catches her before she falls. Claiming to be a medical student, he brings her to his apartment so he can check her twisted ankle. By the way he massages her ankle, she notices that he is no doctor at all. She doesn't care though, cuz she also wanted to explore the city's big dicks!!!

